import SecurityPolicyTable from './SecurityPolicyTable';
import './styles.css';

const SecurityPolicy = () => {
  return (
    <>
      <div className="security-policy-crud-container">
        <div className="security-policy-form-card">
          <h1 className="security-policy-title">Politicas de segurança</h1>
          <form>
            <label>Código</label>
            <input type="text" />
            <label>Utiliza AD</label>
            <select name="" id=""></select>
            <label>Tamanho da senha</label>
            <input type="text" />
          </form>
          <SecurityPolicyTable />
        </div>
      </div>
    </>
  );
};

export default SecurityPolicy;
